import react from "react";
import {Link} from "react-router-dom";

const Navbar = () => {
    return (
        <div className="navbar nav1 bg-dark">
            <nav className="navbar nav1 bg-dark">
                <Link to="/" className="navbar-brand"><h1 className="h1">homepage</h1></Link>
            </nav>
        </div>
    )
}

export default Navbar;
